import{_ as e,o as r,c as t,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 6.2-2211 Other reporting requirements.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-2211.md","filePath":"vacode/6.2-2211.md"}'),n={name:"vacode/6.2-2211.md"},o=i('<h1 id="§-6-2-2211-other-reporting-requirements" tabindex="-1">§ 6.2-2211 Other reporting requirements. <a class="header-anchor" href="#§-6-2-2211-other-reporting-requirements" aria-label="Permalink to &quot;§ 6.2-2211 Other reporting requirements.&quot;">​</a></h1><p>Within 15 days following the occurrence of any of the following events, a licensee shall file a written report with the Commission describing such event and its expected impact upon the business of the licensee:</p><ol><li><p>The filing of bankruptcy, reorganization, or receivership proceedings by or against the licensee;</p></li><li><p>The institution of administrative or regulatory proceedings against the licensee by any governmental authority;</p></li><li><p>Any felony indictments of the licensee or any of its members, partners, directors, officers, or principals;</p></li><li><p>Any felony conviction of the licensee or any of its members, partners, directors, officers, or principals; and</p></li><li><p>Such other event as the Commission may prescribe by regulation.</p></li></ol><p>2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0477" target="_blank" rel="noreferrer">477</a>, § 6.1-491.</p>',4),a=[o];function s(c,l,p,h,f,d){return r(),t("div",null,a)}const g=e(n,[["render",s]]);export{m as __pageData,g as default};
